  false,\n\t\"url\": null,\n\t\"notes\": \"All lobbyist termination fillings submitted
  to the Board of Ethics beginning with the 2011 reporting period. / rnWhen a lobbyist
  terminates all activity that requires registration, the lobbyist must file a termination
  notice and a final activity report that covers the period between the most recently
  filed activity report and the date of termination.rnLobbyist termination information
  is submitted to the Board of Ethics in paper form and is available in its entirety
  in the Board's offices. The Board has, since 2000, compiled and posted static lists
  of all lobbyists and their clients online. Previous policy did not require the Board
  of Ethics to prioritize the reporting of all data available from paper filings.rnFrom
  this point forward, the Board of Ethics will electronically compile more data about
  lobbyists and their activities and automatically report this information online.
  / rnData Owner:  Board of Ethics rn[http://j.mp/kAx6q3] /rnrnTime Period: January
  1, 2011 to present /rnFrequency:  Data is updated daily /rnRelated Applications:
